    true,nt"url": null,nt"notes": "&lt;p&gt;Affordable Vehicle Avionics (AVA)
    is being developed at NASA Ames Research Center and is sponsored by Space Technology
    Mission Directorate (STMD) Game Changing Development Program (GCDP). &amp;nbsp;AVA
    technology is currently at TRL 5+. &amp;nbsp;&lt;/p&gt;&lt;p&gt;AVA will achieve
    desired GN&amp;amp;C precision and capability at order of magnitude lower cost,
    and will:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Develop Avionics and Software&amp;nbsp; emphasizing
    cost vs. performance, and exploit Model-Based Development.&lt;/li&gt;&lt;li&gt;Exploit
    advanced sensor-fusion estimator software to compensate for low commercial-grade
    sensor accuracy.&lt;/li&gt;&lt;li&gt;Employ an &amp;ldquo;Improve, Test, Fly, Improve&amp;rdquo;
    iterative design cycle approach.&lt;/li&gt;&lt;li&gt;Identify broadly based, global
    industries that have achieved adequate levels of quality control and reliability
    in their products and then design around their expertise and business motivations.&lt;/li&gt;&lt;/ul&gt;",nt"license_title":
